import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Particles from "react-particles-js";
import Navbar from "./components/Navbar";
import Header from "./components/Header";


function App() {
  return (
    <>
      <Particles 
        params={{
          particles: {
            number: {
              value: 30,
              density: {
                enable: true,
                value_are: 900
              }
            },
            shape: {
              type: "square",
              stroke: {
                width: 6, 
                color: "#f9ab00"
              }
            }
          }
        }}
      />
      <Navbar />
      <Header />
    </>
  );
}

export default App;
